import axios from "axios";

const BASE_URL = "http://localhost:8080/api/v1/admin";

export const getHome = async () => {
    try {
      const response = await axios.get(`${BASE_URL}/dashboard`);
      
      return response;
    } catch (error) {
      throw new Error("Failed to login");
    }
  };
